import React from 'react';
import { BrowserRouter, NavLink } from 'react-router-dom';
import Info from './components/info';
import Internship from './components/internship';



function Admin() {

    return (
        <BrowserRouter>
        <header>
        <ul className='web'>
          <li><NavLink exact to='/home'>홈</NavLink></li>
          <li><NavLink exact to='/program'>프로그램</NavLink></li>
          <li><NavLink onClick={Info}>Info</NavLink></li>
        </ul>
      </header>
            <Info/>
            <Internship/>
        </BrowserRouter>    
        );
}


export default Admin;
